// SnowAnimation.js
import React from 'react';
import './WinterAnimation.css';

const SnowAnimation = () => {
  const createSnowflakes = () => {
    const snowflakes = [];
    for (let i = 0; i < 50; i++) {
      const snowflakeStyle = {
        left: `${Math.random() * 100}vw`,
        animationDuration: `${Math.random() * 10 + 10}s`,
        animationDelay: `${Math.random() * 5}s`,
      };
      snowflakes.push(<div className="snowflake" style={snowflakeStyle} key={i}></div>);
    }
    return snowflakes;
  };

  return <div className="snow-animation">{createSnowflakes()}</div>;
};

export default SnowAnimation;
